import 'bootstrap/dist/css/bootstrap.min.css';
import ReactNavbar from './components/BsNavbar.js';
import ReactCard from './components/MainCard.js';
import BasicInput from './components/FormComponents.js';

class ReactForm extends React.Component{
  render() {
    return(
      <>
        <Container className = "mt-5 mb-5">
          <ReactCard>
            <BasicInput id="reqst_cd" name="reqst_cd" placeholder="Request Code" type="email" />
          </ReactCard>
        </Container>
      </>
    );
  }
}

class App extends React.Component{
  // constructor(props){
  //   super(props);
  // }
  render() {
    return(
      <>
        <ReactNavbar />
          <ReactForm></ReactForm>
      </>
    );
  }
}

export default App;
